	@Inject
	public GeneradorGrammarAccess(GrammarProvider grammarProvider,
			TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pParafarmacia = new ParafarmaciaElements();
		this.pApariencia = new AparienciaElements();
		this.pProducto = new ProductoElements();
		this.pPrecio = new PrecioElements();
		this.pCategoria = new CategoriaElements();
		this.pTipo = new TipoElements();
		this.pDesplegable = new DesplegableElements();
		this.pPermanente = new PermanenteElements();
		this.pColor = new ColorElements();
		this.pMedida = new MedidaElements();
		this.pCorreo = new CorreoElements();
		this.pRegistro = new RegistroElements();
		this.pDireccion = new DireccionElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("org.xtext.dsl.generador.Generador".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	
	
	public TerminalsGrammarAccess getTerminalsGrammarAccess() {
		return gaTerminals;
	}

	
